import React, { Component } from 'react';
import { Dialog } from "@blueprintjs/core";
import '../App.css';

const material_type = (bool) => {
  return (
    <Dialog isOpen={bool} canOutsideClickClose={true}>Hello World!</Dialog>
  )
}

export {material_type}
